11456	KERNE ELAGAGE	2007-05-14 12:32:08.211917+02	2007-05-14 12:34:26+02	Hent Kervrahu	29000	Quimper	France	paul.puech@kerne-elagage.com	f	t	http://www.kerne-elagage.com/historique11.htm	14	Paul Puech après 4 années, salarié dans une entreprise d'élagage, s'est installé à faux-le-montagne près du lac du Vassivière en Creuse, comme exploitant forestier. Très attaché à la Bretagne, il se fit connaître sur Quimper dès 1982 sous le nom commercial de " Kerne Elagage " ( Kerne signifiant en français Cornouaille ). En 1983, il choisit d'arrêter son activité en Creuse pour développer l'arboriculture Ornementale sur le sud Finistère. Embauchant plus d'un salarié par an et investissant beaucoup dans la formation de personnel, l'entreprise en octobre 1987 fut donc très sollicité pour le dégagement des lieux publics, réseaux électriques et grandes propriétés. Néanmoins, cette catastrophe naturelle a eu un effet pervers à moyen terme et en fin 1989, Kerne Elagage s'est séparé de 7 salariés sur la vingtaine qu'elle comptait et développa l'activité " entretien de jardin " pour faire face à la pénurie de travail en arboriculture et surtout l'excès de concurrents sur le marché. Après trois années de flottement, la profession s'étant équilibrée, l'activité paysage a pu être abandonnée. En 1993, les Mutuelles Sociales Agricoles décerne le 3ème prix à l'entreprise pour son projet " Développement sécurité, formation, individualisation ". Ce challenge consistait à développer l'esprit qualité dans l'entreprise par la formation continue du personnel mais aussi en créant un parc matériel pour chaque technicien. Ceci a considérablement réduit les " pannes sur chantier " car chaque technicien possède 1 Tronçonneuse de Taille, 1 Tronçonneuse d'élagage, 1 Tronçonneuse d'abattage, 2 Tailleuse de haie, 1 Débroussailleuse, l'Ensemble du matériel de Grimpé et 3 Echelles spécifiques. Cet investissement s'est financé par la diminution des coûts d'entretien et en 1999 pour 5 000 000F de C.A, le matériel représente un investissement de 4 000 000F. L'industrialisation du travail a permis en Juillet 1999 de passer au 35 heures sans augmentation des tarifs. Aujourd'hui, 65% des clients sont des particuliers, contre 35% entreprises, collectivités. Cette capacité à répondre à la demande d'une clientèle très différentes est la marque de l'esprit QUALITE de Kerne Elagage.
