11446	NICOT FRIGORIFIQUES	2007-05-14 12:01:31.650701+02	2007-08-31 11:37:48+02	Quai du Moros	29186	CONCARNEAU CEDEX	France	jniel.nicot@wanadoo.fr	f	t	http://www.groupe-nicot.com	14	En 1934, Pierre Nicot ouvre à Melgven un commerce de graines pour une clientèle d'agriculteurs. Dans le courant des années cinquante, avec l'évolution de la demande, il en fait avec son fils Pierre-Henri une chaîne de sept magasins répartis sur la Bretagne occidentale. Parallèlement, il lance un premier chalutier et regroupe ses activités dans la SA Nicot Armement. En 1973, le temps des graineteries traditionnelles est révolu et Nicot ouvre une jardinerie de 2000 m2 à Quimper. Peu après la société reprend les glacières concarnoises et met en place un réseau de distribution de produits surgelés. En 1988, le groupe se structure avec un holding et une filiale par activité : le jardinage, le surgelé, les entrepôts frigorifiques, l'armement à la pêche et la marée. En 1991, Pierre-Henri Nicot prend la direction totale du groupe après avoir épaulé son père pendant 40 ans. Quelques années plus tard, il scinde le groupe en deux parties, une activité mer (qui sera cédée en 2004) et une activité terre. En 1999, est créée une unité de production de plats cuisinés, Savormer. En 2002, Pierre-Yves NICOT reprend la direction du groupe, incarnant la 3ème génération de Nicot à la tête de l'entreprise familiale. L'ouverture, cette année-là, d'une nouvelle jardinerie de 6000 m2 à Quimper et la reprise de la société DIPRAL confortent la diversité et la continuité de l'entreprise.
